 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:center;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#cc9900;font-size:2.32vh;\">Tucked away in a sleepy hamlet near the Kerala \u2013 Tamil Nadu border this green heaven is a slice of Kerala in its entirety with its swaying coconut and arecanut palms, abundant fruit trees, paddy fields, water bodies and unique stay options. Spread across 32 acres of fertile land, Thanima Farm Life offers a bit of everything for all age groups; be it the farming aficionado, the thrill seeking adventure sports enthusiast or the avid nature lover. The farm is a realisation of rigorous work put in over the years by Mr. C.J. Scaria Pillai, a Karshakashree winner, the highest honour for a farmer in Kerala.</SPAN></SPAN></DIV></div>",
